import React, { Component } from "react";
import DDDItem from "./DDDItem";

class DDD extends Component {
  state = {
    ddd: [
      {
        title: '011',      
      },
      {
        title: '016',
      },
      {
        title: '017',
      },
      {
        title: '018',
      },
    ]
  }

  renderList = () =>
    this.state.ddd.map((ddd, index) => {
      //console.log(ddd);
      return <DDDItem key={index} ddd={ddd} />;
    });
  render() {
    return (
      <div className="DDD">{this.state.ddd && this.renderList()}</div>
    );
  }
}

export default DDD;
